import React from 'react';
import {MenuItem} from '../menu-item/menu-item.component';
import './directory.style.scss';

class Directory extends React.Component{
    constructor(){
        super();
    this.state={
        sections:[
            {
            title:'Hats',
            imgUrl:'https://cdn.pixabay.com/photo/2017/05/13/12/40/fashion-2309519__340.jpg',
            id:1
            },
            {
            title:'Jackets',
            imgUrl:'https://cdn.pixabay.com/photo/2015/03/26/09/54/people-690547__340.jpg',
            id:2
            },
            {
            title:'Womens',
            imgUrl:'https://cdn.pixabay.com/photo/2018/02/24/20/41/beautiful-3179182__340.jpg',
            id:3
            },
            {
            title:'Mens',
            imgUrl:'https://cdn.pixabay.com/photo/2016/03/09/09/42/buildings-1245953__340.jpg',
            id:4,
            size:'large'
            }
            ,
            {
            title:'Shoes',
            imgUrl:'https://cdn.pixabay.com/photo/2014/09/03/20/15/legs-434918__340.jpg',
            id:5,
            size:'large'
            }
            ]
        }
    }
    render(){
        return(
            <div className='directory-menu'>
               {
                this.state.sections.map(({title,imgUrl,id,size})=>(
                <MenuItem title={title} key={id} imgUrl={imgUrl} size={size}/>
                ))
                }

            </div>
        
        
        )
    }
}
export default Directory;
